	private static void convertVerticalToHorizontal(int[][] input) {
		
		int[][] newArray = new int[input[0].length/2][]; 
		
		for(int i = 1; i < input[0].length-2; i = i + 2) {

			newArray[i/2] = new int[input.length];
	
			for(int j = 0; j < input.length; j++) {

				newArray[i/2][j] = input[j][i+1];
			}
		}
		
		for(int k = 0; k < newArray.length; k++)
			System.out.println(Arrays.toString(newArray[k]));
	}
	
	private static void buildPoints(int[][] input) {
				
		int[] startPoints = getStatrtEndPoints(input);
		int matrixSize = 2;
		int startPos = startPoints[0] > 0 ? startPoints[0] : 1; 
		int endPos = startPoints[1]; 
		
		//System.out.println("Start: " +startPos +", EndPoint: "+endPos);
		result1 = new int[input[0].length / 2][];
		//result1 = new int[(startPoints[1] - startPoints[0]) / matrixSize ][];
		columnCounter = 0;
		rowCounter = 0;
		
		for(i = 0; i < input[0].length; i = i + 2) {


//			result1[columnCounter] = new int[frequencys[i].length/2];
//			rowCounter = 0;
//			System.out.println("i "+i+ ", frequencys[i].length "+frequencys[i].length  +" "+ result1[columnCounter].length);
			//System.out.println("i "+ i +" "+result1.length );
			
			result1[rowCounter] = new int[(endPos-startPos)/matrixSize+ matrixSize];
			columnCounter = 0;
			result1[rowCounter][columnCounter++] = input[0][i+1];

			for(j = startPos; j < endPos - matrixSize; j = j + matrixSize)	{
				
				buffer = 0;
					
				if(i + matrixSize*2 < input[0].length) {
					
					for(k = 0; k < matrixSize; k++) {
						
						for(l = 0; l < matrixSize * 2 ; l = l + 2) {
							
	//						System.out.println("frequencys[0].length "+frequencys[0].length +", frequencys.length "+frequencys.length
	//							+", i: "+i + ", j: "+j	+", k "+ k+", l "+l);
	//						System.out.println(", i: "+i + ", j: "+j	+", k "+ k+", l "+l+ ", i+k " +(i+k)+", j+l "+(j+l)+" , input[j+k][i+l] "
	//						+input[j+k][i+l]);
							
							buffer += input[j+k][i+l];
						}
					}
				}
				//System.out.println(", i " +i+", j "+ j + " rowCounter "+rowCounter + ", buffer: " +buffer);
				result1[rowCounter][columnCounter++] = buffer / (matrixSize) ;

			}
			rowCounter++;
		}		
			printResult(result1);
	} 
	
	private static int[] getStatrtEndPoints(int[][] input) {
				
		int start = 0;
		int end = 0;
		int check = 0;
		for(int i = 0; i < frequencys.length; i++) {
			
			for(int j = 0; j < frequencys[i].length; j = j + 2) {
				
				if(frequencys[i][j] > 5) {
					start = i;
					check = 1;System.out.println("i: " +i +", j:"+j+", frequencys[i][j+1] "+frequencys[i][j]);
					break;
				}
			}
			if(check > 0)
				break;
		}
		check =0;
		for(int i = frequencys.length-1; i > 0; i--) {
			
			for(int j = 0; j < frequencys[i].length; j = j + 2) {
				
				if(frequencys[i][j] > 5) {
					end = i;
					check = 1; System.out.println("i: " +i +", j:"+j+", frequencys[i][j+1] "+frequencys[i][j]);
					break;
				}
			}
			if(check > 0)
				break;
		}
			return new int[] {start,end};
	}
	
